__NUXT_JSONP__("/svet/stat/kokosove-ostrovy/flora", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n){return {data:[{tabsLoad:{tabWhatToSee:d,tabPrice:d,tabPeople:d,tabTrip:d,tabContact:d,tabHotel:d,tabNeighboring:c,tabVideos:c,tabArticles:c,tabWallSockets:1,tabChains:c,tabFauna:c,tabFlora:c,tabFoods:c,tabBrands:c},place:[{tld:".cc",name:"Kokosové ostrovy",area:14,population:544,slug:j,id_continent:f,information_chatgpt:"\u003Cp\u003EKokosové ostrovy jsou malý stát v Tichomoří, tvořený dvěma atoly - severním a jižním. Nacházejí se asi 2 750 kilometrů severozápadně od Austrálie. Ostrovy jsou známé svými krásnými plážemi, průzračnou vodou a korálovými útesy, což z nich dělá populární destinaci pro potápěče a milovníky vodních sportů.\u003C\u002Fp\u003E\n\u003Cp\u003EMístní obyvatelé jsou hlavně potomci původních obyvatel a původních přistěhovalců z Malajsie, Indonésie a Nového Zélandu. Kokosové ostrovy jsou také domovem mnoha druhů rostlin a zvířat, včetně ohrožených druhů jako například krokodýli sladkovodní a čelikánovec hnědý.\u003C\u002Fp\u003E\n\u003Cp\u003EKokosové ostrovy mají jediné hlavní město, West Island, kde se nachází mezinárodní letiště a několik hotelů a restaurací. Turisté mohou navštívit místní muzeum, kde se dozví více o historii ostrovů a původních obyvatelích. Mezi nejoblíbenější aktivity patří potápění a šnorchlování, kajakářské výlety, rybaření a pozorování ptáků. \u003C\u002Fp\u003E\n\u003Cp\u003EKokosové ostrovy jsou také známé svými produkcemi kokosového oleje, kopry a sušených kokosových ořechů, což je důležitý zdroj příjmů pro místní obyvatele. Místní kuchyně je ovlivněna tradičními jídly z Malajsie a Indonésie, včetně kari, rybích pokrmů a rýžových jídel.\u003C\u002Fp\u003E\n\u003Cp\u003EKokosové ostrovy jsou malý, ale úchvatný kousek země, který nabízí mnoho možností pro odpočinek a relaxaci v překrásné přírodě a pod šuměním palmových stromů. Místo, kde můžete uniknout od každodenního shonu a užívat si krásné pláže a teplé slunce.\u003C\u002Fp\u003E",currency_code:"AUD",currency_name:"Australský dolar",money_prices:[{name:"Taxi (cena za km)",value:k,date_update:b},{name:"Hlavní jídlo",value:15,date_update:b},{name:"Chleba",value:3.5,date_update:b},{name:"Mléko",value:5,date_update:b},{name:"Voda (500ml)",value:1.5,date_update:b},{name:"Espresso",value:f,date_update:b},{name:"Zmrzlina (jeden kopeček)",value:4,date_update:b},{name:"Pivo",value:6,date_update:b},{name:"Krabička cigaret",value:18,date_update:b},{name:"Bic Mac",value:a,date_update:b},{name:"Coca Cola (500ml)",value:k,date_update:b}],phone_numbers_emergency:[{name:"Turistická policie",value:g,date_update:h},{name:"Horská záchranná služba",value:g,date_update:h},{name:"Pobřežní záchranná služba",value:g,date_update:h}],phone_prefix:"+61",coordinates:[{latitude:"-12.1642",longitude:"96.8292"}],people_religion:[{name:"Křesťanství",value:l},{name:"Islám",value:"10%"},{name:"Buddhismus",value:m},{name:"Jiné",value:m}],people_nationality:[{name:"Kokosané",value:l},{name:"Ostatní",value:"20%"}],visitors_entry:[{name:"Občanský průkaz",value:"Občanský průkaz není platným dokladem pro vstup na Kokosové ostrovy. Je třeba mít platný cestovní pas.",date_update:e},{name:"Cestovní pas",value:"Pro vstup na Kokosové ostrovy je třeba mít platný cestovní pas.",date_update:e},{name:"Vízum",value:"Pro turistické cesty do délky 90 dnů není pro občany ČR potřeba žádné vízum. Pokud cestujete za jiným účelem nebo chcete zůstat déle než 90 dní, je potřeba žádat o vízum předem na nejbližší australské ambasádě.",date_update:e},{name:"Očkování",value:"Při vstupu na Kokosové ostrovy není vyžadováno žádné očkování. Nicméně se doporučuje být očkován proti běžným nemocem jako jsou například spalničky nebo zarděnky.",date_update:e},{name:"Cestovní pojištění",value:"Cestovní pojištění není povinné, ale je vřele doporučeno. Zdravotní péče na Kokosových ostrovech je omezená a při vážnějším zdravotním problému je nutné se léčit v Austrálii. Náklady na lékařskou péči v Austrálii mohou být velmi vysoké a proto se doporučuje sjednat si cestovní pojištění s dostatečnou krytím zdravotní péče.",date_update:e},{name:"Bezpečnostní situace",value:"Kokosové ostrovy jsou obecně považovány za bezpečné pro turisty. Nicméně, stejně jako v jiných částech světa, turisté by měli být obezřetní a dodržovat základní bezpečnostní opatření, jako např. nenechávat cennosti nehlídané a vyhýbat se opuštěným oblastem v noci.",date_update:e},{name:"Další informace",value:"Na Kokosových ostrovech je levý jízdní pruh, což je důležité vědět, pokud si plánujete pronajmout auto. Kokosové ostrovy jsou také známé svými krásnými plážemi a podmořským světem, proto je populární aktivitou potápění a šnorchlování. Vzhledem k malému rozsahu ostrovů se doporučuje si pronajmout kolo nebo pěšky prozkoumat okolí. Na ostrovech není mnoho restaurací, ale turisté si mohou zakoupit potraviny v místních obchodech a vařit si sami.",date_update:e}],type_place:n,id_image_cover:i,id_image_hero:i,id_city_main:361,affiliate:[{name:"booking",value:d}],mpz:"CC",alerts:a,zoom:[{google:10,booking:12}],ids_neighboring_countries:[],organization:a,apps:a,links:a,information_author:a,seo_tags:a,language_phrases:a,wall_sockets:a,id:39,facts_place:a,created_at:"2023-12-27T16:33:10.517062+00:00",updated_at:"2023-12-27T17:07:31.480426+00:00"}],imagePlace:[{id:i,name:j,source:"\u002Fworld\u002Fstates\u002F",type:n,author:"cocoskeelingislands.com.au",created_at:"2023-05-06T09:27:42.033044+00:00",updated_at:"2023-12-27T20:42:18.520959+00:00"}],placeContinent:[{id:f,slug:"asie",name:"Asie",area:44580000,population:4630000000,population_density:104.03,number_states:50,information_chatgpt:"\u003Cp\u003E\u003Cb\u003EAsie\u003C\u002Fb\u003E se rozkládá na ploše téměř 44,6 milionu kilometrů čtverečních a žije zde více než 4,5 miliardy lidí, což představuje téměř 60 % celkového počtu obyvatel planety. Kontinent zahrnuje celkem 48 zemí, mezi největší patří \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Frusko\"\u003ERusko\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fcina\"\u003EČína\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Findie\"\u003EIndie\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fjaponsko\"\u003EJaponsko\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Findonesie\"\u003EIndonésie\u003C\u002Fa\u003E\u003C\u002Fb\u003E.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EAsie\u003C\u002Fb\u003E je domovem mnoha významných světových kultur, jako jsou hinduismus, buddhismus, islám a taoismus. V každé zemi se můžeš setkat s odlišnými tradicemi, zvyky a jazyky. Mezi nejnavštěvovanější turistické destinace patří například \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fjaponsko\"\u003EJaponsko\u003C\u002Fa\u003E\u003C\u002Fb\u003E s jeho futuristickými městy, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fthajsko\"\u003EThajsko\u003C\u002Fa\u003E\u003C\u002Fb\u003E s bohatou kulturou a krásnými plážemi, nebo \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Findonesie\"\u003EIndonésie\u003C\u002Fa\u003E\u003C\u002Fb\u003E s neuvěřitelnou přírodou a množstvím ostrovů.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EAsie\u003C\u002Fb\u003E také nabízí mnoho kulturních a historických památek, jako je \u003Cb\u003EVelká čínská zeď\u003C\u002Fb\u003E, \u003Cb\u003ETaj Mahal\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Findie\"\u003EIndii\u003C\u002Fa\u003E\u003C\u002Fb\u003E, buddhistické chrámy v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fthajsko\"\u003EThajsku\u003C\u002Fa\u003E\u003C\u002Fb\u003E a mnoho dalšího. Zajímavou zkušeností může být i návštěva tradičních trhů, kde se dají ochutnat místní speciality a nakoupit různé exotické produkty.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EAsie\u003C\u002Fb\u003E má však také své výzvy a problémy, jako jsou například růst městských oblastí, nedostatek vody a znečištění ovzduší. Mnoho zemí se snaží najít řešení těchto problémů a přizpůsobit se moderním trendům, aby mohly udržet krok s ostatními zeměmi světa.\u003C\u002Fp\u003E\n\u003Cp\u003EPokud tě láká cestování po \u003Cb\u003EAsii\u003C\u002Fb\u003E, měl by sis předem zajistit víza a informovat se o místních zvycích a tradicích. Rozhodně se ti však naskytne možnost prozkoumat jedinečnou kulturu, přírodu a historii tohoto fascinujícího kontinentu.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cb\u003EAsie\u003C\u002Fb\u003E má také neuvěřitelně bohatou gastronomii, která se v jednotlivých zemích a regionech liší. Mezi nejznámější asijské pokrmy patří \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fjidlo\u002Fsushi\"\u003Esushi\u003C\u002Fa\u003E\u003C\u002Fb\u003E, různé druhy nudlí, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fjidlo\u002Fcurry\"\u003Ecurry\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003Edim sum\u003C\u002Fb\u003E, \u003Cb\u003Epho\u003C\u002Fb\u003E a další. Kromě toho se v \u003Cb\u003EAsii\u003C\u002Fb\u003E pěstuje mnoho exotických plodin, jako jsou \u003Cb\u003Eduriany\u003C\u002Fb\u003E, \u003Cb\u003Emangostany\u003C\u002Fb\u003E, \u003Cb\u003Erambutany\u003C\u002Fb\u003E a další ovoce, které můžeš ochutnat pouze zde.\n\u003C\u002Fp\u003E\u003Cp\u003E\n\u003Cb\u003EAsie\u003C\u002Fb\u003E je také známá svými svátky a tradicemi, jako je například \u003Cb\u003Ečínský Nový rok\u003C\u002Fb\u003E, \u003Cb\u003EDiwali\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Findie\"\u003EIndii\u003C\u002Fa\u003E\u003C\u002Fb\u003E, nebo \u003Cb\u003ESongkran\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fthajsko\"\u003EThajsku\u003C\u002Fa\u003E\u003C\u002Fb\u003E,. Tyto svátky jsou většinou spojeny s různými rituály a zvyky, které se v průběhu staletí vyvinuly a jsou dodnes respektovány.\n\u003C\u002Fp\u003E\u003Cp\u003E\nKromě toho má \u003Cb\u003EAsie\u003C\u002Fb\u003E mnoho přírodních krás, jako jsou \u003Cb\u003EHimálaje\u003C\u002Fb\u003E, pouště \u003Cb\u003EGobi\u003C\u002Fb\u003E a \u003Cb\u003EThar\u003C\u002Fb\u003E, nebo tropické pralesy v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Findonesie\"\u003EIndonésii\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmalajsie\"\u003EMalajsii\u003C\u002Fa\u003E\u003C\u002Fb\u003E. V \u003Cb\u003EAsii\u003C\u002Fb\u003E se také nachází mnoho národních parků a chráněných oblastí, kde žijí ohrožené druhy zvířat, jako jsou \u003Cb\u003Etygři\u003C\u002Fb\u003E, \u003Cb\u003Epandy\u003C\u002Fb\u003E, \u003Cb\u003Esloni\u003C\u002Fb\u003E a další.\n\u003C\u002Fp\u003E\u003Cp\u003E\nZkrátka, \u003Cb\u003EAsie\u003C\u002Fb\u003E je kontinent plný kontrastů a neuvěřitelných zážitků, které stojí za to objevovat. Budeš-li mít příležitost navštívit některou z asijských zemí, neváhej a vydaj se na dobrodružnou cestu plnou nových objevů a nezapomenutelných zážitků.\u003C\u002Fp\u003E",coordinates:[{latitude:47.751076,longitude:92.475286}],type_place:"continent",id_image_cover:f,id_image_hero:f,zoom:[{google:2,booking:f}],information_author:a,seo_tags:a,created_at:"2023-12-27T16:35:37.460505+00:00",updated_at:"2023-12-27T17:07:06.531847+00:00"}]}],fetch:{"OrganismsoSidebarListComponent:0":{events:[],images:a}},mutations:[]}}(null,"01-2020",0,true,"04-2023",3,"+61 8 9168 1177","05-2023",411,"kokosove-ostrovy",2.5,"80%","5%","state")));